def stringdictformat(_in,name):
    ret_list = []
    for string in _in:
        temp_dict = ast.literal_eval(string)
        for k, v in list(temp_dict.items()):
            new_key=f"{k}:{name}"
            temp_dict[new_key] = temp_dict.pop(k)
        ret_list.append(temp_dict)
    return ret_list


def string_conv_all(strings,metric,folder):

    #create firdst df
    df = pd.DataFrame(data=strings[0], index=[0])
    for i in range(1,len(strings)):
        temp_df = pd.DataFrame(data=strings[i],index=[0])
        df = df.append(temp_df,ignore_index=True)

    df = (df.T)
    df.to_excel(f'model eval/{folder}/{metric}.xlsx')


def string_conv(string,metric,folder):

    d =  ast.literal_eval(string)
    df = pd.DataFrame(data=d, index=[0])
    df = (df.T)

    print (df)

    df.to_excel(f'model eval/{folder}/{metric}.xlsx')


